"The purpose of ASJABSOM and the JABSOM Classes is to serve as the official body representing the medical students of JABSOM. To that end, purposes include, but are not limited to: 
(1) advocating on behalf of the medical students of JABSOM\;
(2) promoting the welfare of JABSOM and its students;
(3) fostering student morale;
(4) providing a forum for the expression of student interests and concerns to the faculty, administration, and staff;
(5) promoting collaboration between the JABSOM Classes;
(6) supporting academic and social interaction among the students, faculty, administration, and the greater community;
(7) encouraging service in JABSOM and the community;
(8) providing services and activities beneficial to ASJABSOM members, JABSOM, and thecommunity;
(9) selecting student delegates to JABSOM committees and other bodies with campus-widerepresentation; and
(10) directing and regulating the activities of ASJABSOM and the JABSOM Classes. Notwithstanding any provision of this Constitution, the purposes of ASJABSOM and the JABSOM Classes are limited exclusively to non-profit purposes."

"The goals of the International Student Association is to 
to promote global friendship and understanding; 
to support new and continuing students in their educational objectives; 
to explore issues and places in Hawaii; 
to develop leadership among international students; 
to have fun."

"The purpose of this organization is to:
Stimulate a social environment for its members;
Cultivate a support network of scholars who excel in a myriad of academic areas;
Make positive contributions to the community; and
Inform members of upcoming university and community events, seminars, jobs/internship/volunteer opportunities, and university programs such as Study Abroad and National Student Exchange."
